create table backup_hssusua_435614 as (
       select h.c_cpfusua, h.nnumeusua, t.cfonetlusu
        from hssusua h, hsstlusu t
       where h.nnumeusua(+) = t.nnumeusua 
)

select * from backup_hssusua_435614

--tabela usada para adicionar os telefones novos 
create table temp_hssusua_fone1 (
  c_cpfusua varchar2(14),
  cfonetlusu varchar2(20)
)

select * from temp_hssusua_fone1 for update

--########################  montando o script 

declare 

  vExiste number;

  cursor existeTelefone ( pCpf      in varchar2,
                          pIdUsua   in number, 
                          pTelefone in varchar2) is
   
     select count(1)
      from hssusua, hsstlusu
     where nnumeusua  = pIdUsua 
       and hssusua.nnumeusua = hsstlusu.nnumeusua
       and csituusua  = 'A'
       and C_cpfusua  = pCpf
       and cfonetlusu = pTelefone;
 
begin
  for reg in (select U.nnumeusua , u.cnomeusua, U.c_cpfusua , pkg_util.formata_telefone(X.cfonetlusu,'(99)99999-9999') cfonetlusu
                from hssusua U, hsstitu Z, hsstlusu T, temp_hssusua_fone1 X
               where z.NNUMEEMPR is null
                 and u.nnumetitu = z.nnumetitu
                 and U.nnumeusua = T.nnumeusua                 
                 and U.c_cpfusua = X.c_cpfusua 
                 and csituusua = 'A'   
              ) loop
    open existeTelefone(reg.c_cpfusua, reg.nnumeusua, reg.cfonetlusu);
    fetch existeTelefone into vExiste  ;
    
     if (vExiste > 0) then  
      DBMS_OUTPUT.put_line('Ja existe - beneficiario: '||reg.cnomeusua||', CPF: '||reg.c_cpfusua||', Telefone: '||reg.cfonetlusu);
    else
      insert into hsstlusu (nnumeusua,cfonetlusu,COBSETLUSU) 
                    values (reg.nnumeusua,reg.cfonetlusu, 'Solus'); 
    end if;
    close existeTelefone;
  end loop;
end existeTelefone;


